backgroundLength: 8192

.text


# the bits after 0x for colours in the matrix will represent the 
li $t0, BASE_ADDRESS # $t0 stores the base address for display


jal DrawBackground

# draw a saw
# push a pixel location on to the stack
addi $sp, $sp, -4
li $t1, 22272
add $t1, $t1, $t0
sw $t1, 0($sp)

jal DrawSawFrameOne



li $v0, 10 # terminate the program gracefully
syscall

# Draw the background will loop array (this is starting load so its okay future edits will be by pixel to speed things up)
DrawBackground:
    # load the address of the background colors array into $t3
    la $t1, background
    
    # store our index in $t1 and end in $t2
    li $t2, 0
    lw $t3, backgroundLength
    
    
# loop through the array and copy over to our frame buffer
LOOP:
    beq $t2, $t3, END
    
    # copy over background[i] to frame buffer
    # $t4 will contain the osset needed to read the array
    sll $t4, $t2, 2 # $t4 = $t4 * 4 = i * 4 = offset
    
    # calculate the actual addresses we'll read using start + offset store into $t5 and $t6
    add $t5, $t1, $t4
    add $t6, $t0, $t4
    
    # load the value of background[i] and store into framebuffer
    lw $t7, 0($t5)
    
    # multiply by 4 as its 4 per pixel
    li $t4, 4
    mult $t7, $t4
    
    mflo $t7
    sw $t7, 0($t6)
    
    # increment the index
    addi $t2, $t2, 1
    j LOOP
END:
    jr $ra


# Draw the first frame of the saw starting at a location by popping off the stack and storing into register $t7
DrawSawFrameOne:
    # Store colours into $t1-3
    li, $t1, sawDarkGrey
    li, $t2, sawLightGrey
    li, $t3, sawBlack
    
    # pop the pixel location we will be at into $t4
    lw $t4, 0($sp)
    addi $sp, $sp, 4
    
    # row 1
    sw $t1, 0($t4)
    sw $t2, 4($t4)
    sw $t2, 8($t4)
    
    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 2
    sw $t2, -4($t4)
    sw $t1, 0($t4)
    sw $t1, 4($t4)
    sw $t1, 8($t4)
    sw $t1, 12($t4)
    
    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 3
    sw $t2, -4($t4)
    sw $t1, 0($t4)
    sw $t3, 4($t4)
    sw $t1, 8($t4)
    sw $t2, 12($t4)

    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 4
    sw $t1, -4($t4)
    sw $t1, 0($t4)
    sw $t1, 4($t4)
    sw $t1, 8($t4)
    sw $t2, 12($t4)

    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 5
    sw $t2, 0($t4)
    sw $t2, 4($t4)
    sw $t1, 8($t4)
    jr $ra

# Draw the second frame of the saw
DrawSawFrameTwo:
    # Store colours into $t1-3
    li, $t1, sawDarkGrey
    li, $t2, sawLightGrey
    li, $t3, sawBlack
    
    # pop the pixel location we will be at into $t4
    lw $t4, 0($sp)
    addi $sp, $sp, 4
    
    # black rows to make it stand out more
    
    # row 1
    sw $t2, 0($t4)
    sw $t1, 4($t4)
    sw $t2, 8($t4)
    
    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 2
    sw $t1, -4($t4)
    sw $t1, 0($t4)
    sw $t1, 4($t4)
    sw $t1, 8($t4)
    sw $t1, 12($t4)
    
    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 3
    sw $t1, -4($t4)
    sw $t1, 0($t4)
    sw $t3, 4($t4)
    sw $t1, 8($t4)
    sw $t1, 12($t4)

    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 4
    sw $t2, -4($t4)
    sw $t1, 0($t4)
    sw $t1, 4($t4)
    sw $t1, 8($t4)
    sw $t2, 12($t4)

    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 5
    sw $t2, 0($t4)
    sw $t1, 4($t4)
    sw $t2, 8($t4)
    jr $ra

# Draw the third frame of the saw
DrawSawFrameThree:
    # Store colours into $t1-3
    li, $t1, sawDarkGrey
    li, $t2, sawLightGrey
    li, $t3, sawBlack
    
    # pop the pixel location we will be at into $t4
    lw $t4, 0($sp)
    addi $sp, $sp, 4
    
    # row 1
    sw $t2, 0($t4)
    sw $t2, 4($t4)
    sw $t1, 8($t4)
    
    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 2
    sw $t1, -4($t4)
    sw $t1, 0($t4)
    sw $t1, 4($t4)
    sw $t1, 8($t4)
    sw $t2, 12($t4)
    
    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 3
    sw $t2, -4($t4)
    sw $t1, 0($t4)
    sw $t3, 4($t4)
    sw $t1, 8($t4)
    sw $t2, 12($t4)

    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 4
    sw $t2, -4($t4)
    sw $t1, 0($t4)
    sw $t1, 4($t4)
    sw $t1, 8($t4)
    sw $t1, 12($t4)

    # shift to the next row
    addi, $t4, $t4, WIDTH_BY_4
    
    # row 5
    sw $t1, 0($t4)
    sw $t2, 4($t4)
    sw $t2, 8($t4)
    jr $ra

# Draw shifting saw given a start point and an end point horizontally
DrawSawShiftingHorizontal:
    # pop the end then the start off the stack store into $t1
    lw $t4, 0($sp)
    addi $sp, $sp, 4    
    jr $ra
    
# Draw shifting saw given a start point and an end point vertically
DrawSawShiftingVertical:
    jr $ra
    
# Draw a spike starting at a point and length that the spike should be
# Register based as multiple spikes will be on the screen moving at same time
# Dont want to queue and dequeue from the stack multiple times
DrawSpikeFloorMoving:
    jr $ra
    
# Draw a moving platform given a start point and endpoint horizontally
# If player standing on it they move with it horizontally
DrawPlatformMovingHorizontally:
    jr $ra
    
# Draw a moving platform given a start point and endpoint vertically
# If player standing on it they move with it vertically
DrawPlatformMovingVertically:
    jr $ra
    
# Draws a heart given a start point
DrawHeart:
    jr $ra
    
# Reads number of lives off the stack and draws heart accordingly
DrawLives:
    jr $ra


# Runs the game loop after the frame sleep duration is over
FrameSleepEnd:
    jr $ra


 
 
